<section id="o_mnie" class="about-section">
<div class="container">
<img src="/img/realizacje_img.png" alt="O mnie" class="img-responsive"/>			</div>
<div class="container description text-center">
Jestesmy mloda, prezna firma dzialajaca w zakresie zakladania, pielegnacji i projektowania terenow zieleni. W naszych realizacjach stawiamy na jakosc oraz wygode pozniejszego uzytkowania, tak by ogrod byl efektowny, a panstwo czuli sie w nim komfortowo.<br />
Do kazdego klienta podchodzimy indywidualnie i staramy sie sprostac jego oczekiwaniom. Nie boimy sie wyzwan, ktore zmuszaja nas do tworzenia nowatorskich rozwiazan. Stale sie rozwijamy i podnosimy nasze kwalifikacje. <br />
<br />
Nasza oferta dotyczy glownie klientow indywidualnych, w mniejszym stopniu malych i srednich firm. <br />
<br />
<b>Garden-ska</b> Izabela Czekalska<br />
